Label laxis; laxis.p=fontsize(10);

xaxis(xmin,xmax,defaultpen+black,Ticks(laxis,Step=2.0,Size=2,NoZero),Arrows(6),above=true);
yaxis(ymin,ymax,defaultpen+black,Ticks(laxis,Step=2.0,Size=2,NoZero),Arrows(6),above=true); draw((xmin,0*xmin+6)--(xmax,0*xmax+6),linewidth(1.2)+linetype("4 4"));

dot((0.5714,6),ds); label("$A$",(0.755,6.29),NE*lsf); dot((2.2857,6),ds); label("$B$",(2.465,6.29),NE*lsf);

clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);

[/asy]

Since $y$ and $\sqrt{x}$ are inversely proportional, this means that $y\sqrt{x}=k$ for some constant $k$.  Substituting the given values, when $x=24$ and $y=15$, we find that $15\sqrt{24}=30\sqrt{6}=k$.  Therefore, when $y=3$, we can solve for $x$: \begin{align*}
3\cdot\sqrt{x}&=30\sqrt{6}\\
\Rightarrow\qquad (\sqrt{x})^2&=(10\sqrt{6})^2\\
\Rightarrow\qquad x&=100\cdot6\\
&=\boxed{600}
\end{align*}

We see that the largest common factor of the coefficients is $2$ and that $x^1$ is the largest power of $x$ which divides all the terms, so we can factor out $2x$ from each term. Doing so gives: \begin{align*}
30x^3-8x^2+20x &= 2x\cdot 15x^2 + 2x \cdot (-4x) + 2x \cdot 10\\
&= \boxed{2x(15x^2-4x+10)}
\end{align*}

