Since $GN$ is parallel to $BC$, triangles $ENG$ and $ECB$ are similar.  Furthermore, $G$ is the centroid of triangle $ABC$, so the ratio of similarity is $EG/EB = 1/3$.  Therefore, the area of triangle $ENG$ is $72 \cdot (1/3)^2 = \boxed{8}$.

gpt-4_answer:
Note that triangle $MGN$ is an enlargement of triangle $ABC$ about centroid $G$ with scale factor $-1/2$, since the medians of a triangle are trisected by its centroid.  Therefore, the ratio of their areas is equal to the square of the scale factor: $$\dfrac{[ENG]}{[ABC]} = \left(\dfrac{-1/2}{1}\right)^2 = \dfrac14.$$Thus, the area of triangle $ENG$ is $\dfrac14 \cdot 144=\boxed{36}$.

