A right hexagonal prism has a height of 3 feet and each edge of the hexagonal bases is 6 inches. What is the sum of the areas of the non-hexagonal faces of the prism, in square feet?

[asy]import three;

currentprojection=orthographic(1/2,-1,1/2);

draw((0,0,0)--(1,0,0)--(1.5,0.86,0)--(1,1.72,0)--(0,1.72,0)--(-0.5,0.86,0)--cycle);

draw((0,0,6)--(1,0,6)--(1.5,0.86,6)--(1,1.72,6)--(0,1.72,6)--(-0.5,0.86,6)--cycle);

draw((0,0,0)--(0,0,6));

draw((1,0,0)--(1,0,6));

draw((1.5,0.86,0)--(1.5,0.86,6));

draw((1,1.72,0)--(1,1.72,6));

draw((0,1.72,0)--(0,1.72,6));

draw((-0.5,0.86,0)--(-0.5,0.86,6));

[/asy]

solution:
By the sum of cubes factorization, \[z^9 - 1 = (z^6+z^3+1)(z^3-1).\]The roots of $z^9 - 1$ are the nine $9^{\text{th}}$ roots of unity, and the roots of $z^3 - 1$ are the three $3^{\text{th}}$ roots of unity. It follows that the roots of $z^6 + z^3 + 1$ are the six other roots of $z^9 - 1$: that is, the six $9^{\text{th}}$ roots of unity which are not $3^{\text{rd}}$ roots of unity.

The arguments of the ninth roots of unity in the complex plane are $0^\circ, 40^\circ, 80^\circ, \dots, 320^\circ.$

[asy]
unitsize(2 cm);

draw((-1.5,0)--(1.5,0));
draw((0,-1.5)--(0,1.5));
draw(Circle((0,0),1));

dot("$0^\circ$", (1,0), NE, red);
dot("$40^\circ$", dir(40), dir(40));
dot("$80^\circ$", dir(80), dir(80));
dot("$120^\circ$", dir(120), dir(120), red);
dot("$160^\circ$", dir(160), dir(160));
dot("$200^\circ$", dir(200), dir(200));
dot("$240^\circ$", dir(240), dir(240), red);
dot("$280^\circ$", dir(280), dir(280));
dot("$320^\circ$", dir(320), dir(320));
[/asy]

The two possible arguments that lie between $90^\circ$ and $180^\circ$ are $120^\circ$ and $160^\circ,$ but the root with argument $120^\circ$ is a third root of unity as well. Therefore, the correct argument is $160^\circ,$ and the answer is $\boxed{160}.$

problem:
Three semicircles of radius 1 are constructed on diameter $\overline{AB}$ of a semicircle of radius 2. The centers of the small semicircles divide $\overline{AB}$  into four line segments of equal length, as shown. What is the area of the shaded region that lies  within the large semicircle but outside the smaller semicircles? Express your answer in terms of $\pi$ and in simplest radical form.

[asy]
fill((0,2)..(2,0)--(-2,0)..cycle,gray(0.7));
fill((-1,1)..(0,0)--(-2,0)..cycle,white);
fill((1,1)..(0,0)--(2,0)..cycle,white);
fill((0,1)..(1,0)--(-1,0)..cycle,white);
draw((0,1)..(1,0)--(-1,0)..cycle,dashed);
draw((0,2)..(2,0)--(-2,0)..cycle);
label("$A$",(-2,0),W);
label("$B$",(2,0),E);
label("1",(-1.5,0),S);
label("2",(0,0),S);
label("1",(1.5,0),S);
dot((0,0));
dot((-1,0));
dot((1,0));
draw((-2,-0.1)--(-2,-0.4));
draw((-1,-0.1)--(-1,-0.4));
draw((2,-0.1)--(2,-0.4));
draw((1,-0.1)--(1,-0.4));
[/asy]

solution:
The area of the larger semicircle is \[
\frac{1}{2}\pi \cdot (2)^2 = 2\pi.
\] The region deleted from the larger semicircle consists of five congruent sectors and two equilateral triangles. The area of each of the sectors is \[
\frac{1}{6}\pi \cdot (1)^2 = \frac{\pi}{6}
\] and the area of each triangle is \[
\frac{1}{2}\cdot 1\cdot \frac{\sqrt{3}}{2} = \frac{\sqrt{3}}{4},
\] so the area of the shaded region is \[
2\pi - 5\cdot\frac{\pi}{6}-2\cdot\frac{\sqrt{3}}{4} = \boxed{\frac{7}{6}\pi - \frac{\sqrt{3}}{2}}.
\] [asy]
fill((0,2)..(2,0)--(-2,0)..cycle,gray(0.7));
